import React from "react";
import { useState } from "react";
import "./index.css"

const App = () =>{

  const crnTime = new Date().getTime()
  const [newTime, setNewTime] = useState(crnTime)
  const UpTime = () =>{
    crnTime = new Date().toTimeString()
    setNewTime(crnTime)
  }
    
  return(
      <div className="heading">
          <h1>{crnTime}</h1>
          <button onClick={UpTime}>Get Time</button>
      </div>
  )
}
export default App;
